import { Button } from '@mui/material';
import React from 'react'
import ReactPlayer from 'react-player';
function Feed() {
    return (
        <div className='flex flex-col justify-center items-center my-'>
            <div>
                <Button variant='outlined'>Upload Video</Button>
            </div>
            <div>
                <ReactPlayer width='40%'
                    loop={true} height='100%' url="http://commondatastorage.googleapis.com/gtv-videos-bucket/sample/ElephantsDream.mp4" controls={false}></ReactPlayer>
            </div>
        </div>
    )
}

export default Feed
